sys_variable_value.value:
(function execute(inputs, outputs) {
  var responseObj = JSON.parse(inputs.response_body);
  outputs.name = responseObj.name;
  outputs.email = responseObj.email;
  outputs.admin = responseObj.admin;
  outputs.policy_manager = responseObj.policyManager;
  outputs.watch_manager = responseObj.watchManager;
  outputs.reports_manager = responseObj.reportsManager;
  outputs.group_admin = responseObj.groupAdmin;
  outputs.profile_updatable = responseObj.profileUpdatable;
  outputs.internal_password_disabled = responseObj.internalPasswordDisabled;
  outputs.last_logged_in = responseObj.lastLoggedIn;
  outputs.last_logged_in_millis = responseObj.lastLoggedInMillis;
  outputs.status = responseObj.status;
  outputs.credentials_expired = responseObj.credentialsExpired;
  outputs.number_of_groups = responseObj.numberOfGroups;

  if("groups" in responseObj){
    outputs.groups = [];
    for(var i = 0; i < responseObj.groups.length; i++) {
      outputs.groups[i] = responseObj.groups[i];
    }
  }
})(inputs, outputs);

